The stages of radio-electronic equipment design are as follows:
1. Development of the technical specification;
2. Analysis of technical proposals;
3. Preliminary design;
4. Design and manufacture of technological equipment;
5. Implementation and manufacture of radio-electronic equipment;
6. Its testing and debugging;
7. Implementation and operation of the equipment.

In America, hurricanes are classified on the five-point Saffir-Simpson scale: 
1. Category 1 (wind speed from 119 to 153 km/h);
2. Category 2 (wind speed from 154 to 177 km/h);
3. Category 3 (wind speed from 178 to 208 km/h);
4. Category 4 (wind speed from 209 to 251 km/h);
5. Category 5 (wind speed over 252 km/h).

