To choose a good gift for a child, you need to consider their interests and hobbies. Usually, children aged 8-10 years old enjoy:

1. Construction sets or creative kits (modeling, woodcarving);
2. Age-appropriate board games, such as a children's version of Imaginarium, Elias, or Erudit;
3. Books: some children like encyclopedias about how the world works, while others at this age still enjoy reading fairy tales;
4. Bicycles, roller skates, trampolines, and other equipment for active recreation.

Grigori Perelman was awarded the following prizes:
- In 1991, Perelman received the St. Petersburg Mathematical Society's Young Mathematician Prize for his work on Alexandrov spaces of curvature;
- In 1996, Perelman was awarded the European Mathematical Society Prize for young mathematicians, which he declined to accept;
- In 2006, Perelman was awarded the Fields Medal, but he declined to accept it;
- In 2010, Perelman was awarded the Millennium Prize for the proof of the Poincaré conjecture.

Here are several elements that a well typically has:
- head;
- shaft;
- water intake;
- mechanism for lifting water to the surface ("well sweep" or "well crane").
